import React from 'react'
import TileGrid from 'components/tile-grid.component'

export default class CountryOutput extends React.Component {

	loading:boolean=true

	render(){
		return (
			<div id="output">
				{this.loading ? <div className="loading">Loading...</div> : null}
				<TileGrid />
			</div>
		)
	}
}
